CREATE TABLE `contenidodetalle` (
  `ccodcontenido` varchar(24) NOT NULL,
  `cdetcontenido` longtext NOT NULL,
  PRIMARY KEY (`ccodcontenido`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

/*Data for the table `contenidodetalle` */

insert  into `contenidodetalle`(`ccodcontenido`,`cdetcontenido`) values ('12172807150531163407V2F8','<div class=\"clear\">\r\n<ul>\r\n<li>Catastro.</li>\r\n<li>Topograf&iacute;a y Geodesia.</li>\r\n<li>Medio Ambiente.</li>\r\n<li>Sistemas de Informaci&oacute;n Geogr&aacute;fica y Sistemas.</li>\r\n<li>Ordenamiento del Territorio.</li>\r\n<li>Capacitaci&oacute;n.</li>\r\n<li>Prevenci&oacute;n de Riesgos.</li>\r\n</ul>\r\n</div>\r\n<div class=\"ctn_estilo_col_1\">\r\n<div class=\"estilo_col_1\">\r\n<div class=\"titulo\">MISI&Oacute;N</div>\r\n<div class=\"detalle\">Brindar soluciones y servicios que apoyen la gesti&oacute;n de las organizaciones y empresas, principalmente a los procesos de toma de decisiones.</div>\r\n</div>\r\n<div class=\"estilo_col_1\">\r\n<div class=\"titulo\">VISI&Oacute;N</div>\r\n<div class=\"detalle\">Dar soluciones de avanzada e implementar procesos de continua investigaci&oacute;n que nos permitan posicionarnos como la empresa l&iacute;der en de nuestro rubro.</div>\r\n</div>\r\n<div class=\"estilo_col_1\">\r\n<div class=\"titulo\">FILOSOF&Iacute;A</div>\r\n<div class=\"detalle\">Adquisici&oacute;n constante de tecnolog&iacute;a de punta y capacitaci&oacute;n permanente del personal, para proporcionar un servicio y soporte de calidad total y permanente.</div>\r\n</div>\r\n</div>'),('121728071506022053056C3R','                    <p>&nbsp;</p>\r\n<ol>\r\n<li>Soluciones GIS a medida aplicado Cartograf&iacute;a, Geolog&iacute;a, Miner&iacute;a, Gas,Geomarketing, Inteligencia de Negocios, implementaci&oacute;n gis en la Nube,&nbsp;Catastro, Predios, Geo codificaci&oacute;n y Geolocalizaci&oacute;n&nbsp;</li>\r\n<li>Soluciones GIS en Gobiernos Locales y Regionales y Procesos de&nbsp;Negocio de la empresa&nbsp;</li>\r\n<li>Procesamiento de Datos en Formato Gis y Cad y otros formatos</li>\r\n<li>Digitalizaci&oacute;n de Mapas y planos en formatos Gis.</li>\r\n<li>Generaci&oacute;n de modelamientos GIS</li>\r\n<li>Sistemas GIS Web, Smartphones, M&oacute;viles, Tablets, Escritorio, con&nbsp;relaci&oacute;n a base de datos relacional</li>\r\n<li>Integraci&oacute;n de Sistemas GIS con Aplicaciones Google Earth, Maps, otros&nbsp;Con servicios interoperables</li>\r\n</ol>                    '),('1217280715060221544980QZ','<p style=\"text-align: left;\" align=\"justify\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">Un&nbsp;sistema de informaci&oacute;n geogr&aacute;fica&nbsp;(tambi&eacute;n conocido con los acr&oacute;nimos SIG en espa&ntilde;ol o GIS en ingl&eacute;s) es un conjunto de herramientas que integra y relaciona diversos componentes (usuarios,&nbsp;<a title=\"Hardware\" href=\"http://es.wikipedia.org/wiki/Hardware\">hardware</a>,&nbsp;<a title=\"Software\" href=\"http://es.wikipedia.org/wiki/Software\">software</a>, procesos) que permiten la organizaci&oacute;n, almacenamiento, manipulaci&oacute;n, an&aacute;lisis y modelizaci&oacute;n de grandes cantidades de datos procedentes del mundo real que est&aacute;n vinculados a una referencia espacial, facilitando la incorporaci&oacute;n de aspectos sociales-culturales, econ&oacute;micos y ambientales que conducen a la toma de decisiones de una manera m&aacute;s eficaz.</span></p>\r\n<p style=\"text-align: left;\" align=\"justify\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"><strong>Consultor&iacute;a </strong></span><br /><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"> Disponemos de un equipo de consultores con amplia experiencia, capaces de analizar la situaci&oacute;n actual de una organizaci&oacute;n y proyectarla al futuro atendiendo a las necesidades expuesta por la direcci&oacute;n.</span></p>\r\n<p style=\"text-align: left;\" align=\"justify\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">aporta informaci&oacute;n geogr&aacute;ficamente referenciada ayudando a nuestros clientes en tareas de informaci&oacute;n, planificaci&oacute;n y gesti&oacute;n de sus instalaciones de forma f&aacute;cil y &aacute;gil.</span><br /><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"> <strong> Desarrollos a medida </strong></span><br /><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"> Realizamos desarrollos atendiendo a las necesidades de nuestros clientes. Partimos de los requerimientos expresados por nuestros clientes y aplicando nuestra propia metodolog&iacute;a de desarrollo llegamos a obtener un producto final acorde con los requerimientos expresados.</span></p>\r\n<p style=\"text-align: left;\" align=\"justify\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">ofrecemos &nbsp;a nuestros clientes servicios de desarrollo a medida de aplicaciones y herramientas SIG que facilitan a usuarios de perfil t&eacute;cnico las tareas de gesti&oacute;n y realizaci&oacute;n de an&aacute;lisis avanzados de informaci&oacute;n con una componente geogr&aacute;fica. Estos servicios est&aacute;n dirigidos a organizaciones que desarrollan su actividad en los campos de la ingenier&iacute;a civil, la arquitectura, el urbanismo, la gesti&oacute;n del suelo, el medioambiente etc.</span></p>\r\n<p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">Las principales &aacute;reas de desarrollo son las siguientes:</span></p>\r\n<ol>\r\n<li><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"><strong><em>Desarrollo de aplicaciones SIG de gesti&oacute;n</em></strong><strong>:</strong>&nbsp;Orientadas a personal de perfil t&eacute;cnico, estas herramientas se caracterizan por proporcionar grandes capacidades de procesado de la informaci&oacute;n, as&iacute; como m&uacute;ltiples herramientas que permiten gestionar, analizar y explotar la informaci&oacute;n geogr&aacute;fica disponible en las organizaciones.</span></li>\r\n</ol>\r\n<div align=\"center\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">&nbsp;</span></div>\r\n<ol>\r\n<li><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"><strong><em>Desarrollo de aplicaciones SIG de publicaci&oacute;n</em>:</strong>&nbsp;Permiten a las organizaciones publicar en Internet informaci&oacute;n geogr&aacute;fica. Orientadas a usuarios de perfil general, ofrecen una interfaz amigable, enla que se cuida especialmente la usabilidad y la accesibilidad a la informaci&oacute;n.</span></li>\r\n</ol>\r\n<div align=\"center\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">&nbsp;</span></div>\r\n<p align=\"justify\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/jpeg;base64,\" alt=\"\" width=\"231\" height=\"130\" /></span><br /><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"> <strong>Implantaci&oacute;n GIS Corporativos (Geosistemas, GIS especializados)</strong></span><br /><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"> Nos encargamos de la direcci&oacute;n y ejecuci&oacute;n de complejos proyectos de implantaci&oacute;n de GIS Corporativos: GeoSistemas y/o GIS especializados. Cabe resaltar que no estamos vinculados a ning&uacute;n fabricante, tenemos independencia en nuestras implantaciones. Por tanto, tenemos una clara orientaci&oacute;n al cliente e implantamos soluciones alineadas con sus estrategias.</span></p>\r\n<p align=\"justify\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">&nbsp;</span></p>\r\n<p align=\"center\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://www.qgis.org/en/_images/qgisdesktopscreenshot.jpg\" alt=\"QGIS Desktop\" width=\"291\" height=\"231\" /></span></p>\r\n<p align=\"justify\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"><strong>Formaci&oacute;n</strong></span></p>\r\n<p align=\"justify\"><br /><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"> Impartimos cursos con el objetivo de formar a nuestros clientes. Los cursos de formaci&oacute;n se preparan especificamente para cubrir las necesidades de nuesrtros clientes, nunca preparamos cursos gen&eacute;ricos orientados al p&uacute;blico en general. Siempre son cursos a medida y nos centramos en las funcionalidades demandadas, utilizamos los datos propios del cliente.</span></p>\r\n<p align=\"justify\"><br /><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"> <strong> Outsourcing tecnol&oacute;gico</strong></span></p>\r\n<p align=\"justify\"><br /><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"> Tenemos gran experiencia en el outsourcing tecnol&oacute;gico orientado al despliegue de GIS Corporativos. Trabajamos con socios en diferentes datacenter especializados y desplegamos soluciones en la nube.</span></p>\r\n<p align=\"justify\"><br /><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"> <strong>Outsourcing TI y procesos empresariales</strong></span></p>\r\n<p align=\"justify\"><br /><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"> Estamos especializado tanto en la externalizaci&oacute;n de TI como de los procesos empresariales. Disponemos de un modelo de costes claro, ofrecemos inteligencia e inovaci&oacute;n y garantizamos el cumplimiento del contrato minimizando riesgos.</span></p>\r\n<p align=\"justify\">&nbsp;</p>\r\n<p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"><strong>Servicios de Implementacion de Sistemas de Informacion Geografica</strong></span></p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">Soluciones GIS a medida aplicado Cartograf&iacute;a, Geolog&iacute;a, Miner&iacute;a, Gas,Geomarketing, Inteligencia de Negocios, implementaci&oacute;n gis en la Nube,&nbsp;Catastro, Predios, Geo codificaci&oacute;n y Geolocalizaci&oacute;n&nbsp;</span></li>\r\n<li><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">Soluciones GIS en Gobiernos Locales y Regionales y Procesos de&nbsp;Negocio de la empresa&nbsp;</span></li>\r\n<li><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">Procesamiento de Datos en Formato Gis y Cad y otros formatos</span></li>\r\n<li><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">Digitalizaci&oacute;n de Mapas y planos en formatos Gis.</span></li>\r\n<li><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">Generaci&oacute;n de modelamientos GIS</span></li>\r\n<li><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">Sistemas GIS Web, Smartphones, M&oacute;viles, Tablets, Escritorio, con&nbsp;relaci&oacute;n a base de datos relacional</span></li>\r\n<li><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">Integraci&oacute;n de Sistemas GIS con Aplicaciones Google Earth, Maps, otros&nbsp;Con servicios interoperables</span></li>\r\n</ol>\r\n<p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"><strong>Movilidad GIS</strong></span><br /> <br /><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"> Las necesidades de movilidad han llegado al sector de los sistemas de informaci&oacute;n geogr&aacute;fica para facilitar y agilizar los procesos en los que la ubicaci&oacute;n de los elementos es importante. La reducci&oacute;n de costos y la exigente competitividad hacen creciente la necesidad de acceder a la informaci&oacute;n en el momento y lugar en que se origina, as&iacute; como a los datos geogr&aacute;ficos corporativos, desde cualquier dispositivo m&oacute;vil y en cualquier lugar en que nos encontremos.</span></p>\r\n<p align=\"center\"><img src=\"http://www.geoenterprice.com/imagen/informacion-geografica-1_clip_image001_0000.jpg\" alt=\"Geograma_Aplicaciones_mapas_para_telefonos_moviles\" /></p>\r\n<p><br /><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"> Gracias a la arquitectura m-GIS desarrollada por <strong>Soluciones Enterprice</strong>, ofrecemos soluciones de movilidad SIG que le permitir&aacute;n:</span></p>\r\n<ul>\r\n<li><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">Conectarse a la base de datos corporativa mediante dispositivos m&oacute;viles</span></li>\r\n<li><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">Consultar mapas e informaci&oacute;n asociada remotamente</span></li>\r\n<li><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">Sincronizar datos geogr&aacute;ficos</span></li>\r\n<li><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">Desarrollar aplicaciones m&oacute;viles con funcionalidad geogr&aacute;fica</span></li>\r\n</ul>\r\n<p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">En <strong>Soluciones Enterprice</strong> sabemos que el reto del GIS m&oacute;vil no es s&oacute;lo realizar de forma m&aacute;s eficiente el mismo trabajo que se hac&iacute;a hasta ahora, sino orientar a todos los usuarios hacia un nuevo modelo de GIS: los usuarios, clientes, los servicios, las herramientas, etc,&hellip; cada vez m&aacute;s componentes de los sistemas de informaci&oacute;n geogr&aacute;fica se encuentran fuera de las oficinas.</span></p>'),('12172807150604140109GKGL','<p><span><strong>&nbsp;Definicion:</strong></span></p>\r\n<p><span>Son bases de datos cuyo &uacute;nico fin es el env&iacute;o y recepci&oacute;n de datos a grandes velocidades, estas bases son muy poco comunes y est&aacute;n dirigidas por lo general al entorno de an&aacute;lisis de calidad, datos de producci&oacute;n e industrial, es importante entender que su fin &uacute;nico es recolectar y recuperar los datos a la mayor velocidad posible, por lo tanto la redundancia y duplicaci&oacute;n de informaci&oacute;n no es un problema como con las dem&aacute;s bases de datos, por lo general para poderlas aprovechar al m&aacute;ximo permiten alg&uacute;n tipo de conectividad a bases de datos relacionales.</span></p>\r\n<p><span>Un ejemplo habitual de transacci&oacute;n es el traspaso de una cantidad de dinero entre cuentas bancarias. Normalmente se realiza mediante dos operaciones distintas, una en la que se decrementa el saldo de la cuenta origen y otra en la que incrementamos el saldo de la cuenta destino. Para garantizar la atomicidad del sistema (es decir, para que no aparezca o desaparezca dinero), las dos operaciones deben ser at&oacute;micas, es decir, el sistema debe garantizar que, bajo cualquier circunstancia (incluso una ca&iacute;da del sistema), el resultado final es que, o bien se han realizado las dos operaciones, o bien no se ha realizado ninguna.</span></p>\r\n<p><span><strong>Por lo cual solucines enterprice ofrece las siguientes servicios:</strong></span></p>\r\n<p><span>&nbsp;</span></p>\r\n<ol>\r\n<li><span><strong>Implementaci&oacute;n y Administraci&oacute;n de Base de Datos Oracle 9i, 10g, 11g R2 y 12c R1 sobre plataforma GNULinux y Windows Server (2003,2008 R2 y 2012 R2).&nbsp;</strong></span></li>\r\n<li><span><strong>Administraci&oacute;n de Base de Datos Espacial Oracle</strong></span></li>\r\n<li><span><strong>Sincronizaci&oacute;n de Base de datos Espacial (Configuraci&oacute;n de SDE).</strong></span></li>\r\n<li><span><strong>Modificaci&oacute;n de par&aacute;metros de Base de datos, optimizaci&oacute;n de Base de datos, Implementaci&oacute;n de pol&iacute;ticas de seguridad, auditoria de objetos y usuarios, seguimiento&nbsp; por Trazas, configuraci&oacute;n de Jobs, modificaci&oacute;n de registros, Monitoreo de crecimiento indiscriminado de tablespaces temporales.</strong></span></li>\r\n<li><span><strong>Instalaci&oacute;n y configuraci&oacute;n de servidores de base de datos GIS y transaccional:</strong></span></li>\r\n</ol>\r\n<p><span>La instalaci&oacute;n incluye la configuraci&oacute;n y arreglo de discos (RAID 0, RAID 1, RAID 5, RAID 10), adem&aacute;s de estar basado en la arquitectura optima flexible recomendada por Oracle Sobre las siguientes plataformas tecnol&oacute;gicas:</span></p>\r\n<p><span><strong>Servidor hp proliant</strong>&nbsp;dl360&nbsp; g5,&nbsp; windows server 2003 y red hat enterprise linux 4.8 (oracle 9i)</span></p>\r\n<p><span>Servidores ibm system x 3550, red hat enterprise linux 5.3 y centos 5.4 (oracle 10g)</span></p>\r\n<p><span>Servidores&nbsp; dell power edge t320, oracle linux enterprise 5.7 y oracle linux enterprise 6.3 (oracle 11gr2 y oracle12c)</span></p>\r\n<p><span><strong>Servidores ibm system x 3100 m4</strong>, suse enterprise linux 10 (oracle 11gr2)&nbsp;</span></p>\r\n<p><span>Administraci&oacute;n de sistemas operativos linux&nbsp; (red hat enterprise linux, centros, ubuntu, fedora core, trisquel)</span></p>\r\n<p><span>Configuraci&oacute;n de servicios linux: samba, administraci&oacute;n&nbsp; de&nbsp; usuarios, network file system, administraci&oacute;n de</span></p>\r\n<p><span><strong>Seguridad&nbsp; a&nbsp; nivel&nbsp; de&nbsp; directorio</strong>, asignaci&oacute;n de permisos.</span></p>\r\n<p><span>Implementaci&oacute;n de backup incrementales de tipo l&oacute;gico (datapump) y f&iacute;sico (rman).</span></p>\r\n<p><span>Backup y restore l&oacute;gico de base de datos oracle (.dmp) con herramienta exp/imp tradicional y con datapump Expdp/impdp, etc.</span></p>\r\n<p><strong>&nbsp;</strong></p>'),('12172807150604140424ZO16','<p><strong>Base de datos espacial</strong>&nbsp;(<strong>spatial database</strong>) es un sistema administrador de&nbsp;bases de datos&nbsp;que maneja datos existentes en un espacio o&nbsp;<strong>datos espaciales</strong>.</p>\r\n<p>En este tipo de bases de datos es imprescindible establecer un cuadro de referencia (un SRE,&nbsp;Sistema de Referencia Espacial) para definir la localizaci&oacute;n y relaci&oacute;n entre objetos, ya que los datos tratados en este tipo de bases de datos tienen un valor relativo, no es un valor absoluto. Los sistemas de referencia espacial pueden ser de dos tipos:<strong>georreferenciados</strong>&nbsp;(aquellos que se establecen sobre la superficie terrestre. Son los que normalmente se utilizan, ya que es un dominio manipulable, perceptible y que sirve de referencia) y&nbsp;<strong>no georreferenciados</strong>&nbsp;(son sistemas que tienen valor f&iacute;sico, pero que pueden ser &uacute;tiles en determinadas situaciones).</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Servicios de sistemas, base de datos espaciales y Comunicaciones ofrecido por Soluciones Enterprice SAC</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<ol>\r\n<li>Configuraci&oacute;n de servidores (Sql server, postgre, postgis,etc)</li>\r\n<li>Creaci&oacute;n o implementaci&oacute;n de Base de datos.</li>\r\n<li>Migraci&oacute;n de base de datos (de shapes a BDE entre otras opciones)</li>\r\n<li>Estandarizaci&oacute;n y Normalizaci&oacute;n de Base de datos espaciales.</li>\r\n<li>Consultor&iacute;a sobre Aplicaciones de Sistemas GIS&nbsp;&nbsp; o Base de datos espaciales</li>\r\n<li>Dise&ntilde;o de Sistemas GIS aplicaciones personalizados</li>\r\n<li>Implementaci&oacute;n, venta y soporte de Servidores</li>\r\n<li>Arquitectura de Redes y Comunicaciones, cableado estructurado, telefon&iacute;a.</li>\r\n</ol>'),('12172807150604141805DEVL','<p><span style=\"font-size: small;\"><span>Es la ciencia que se encarga del estudio y la elaboraci&oacute;n de los mapas geogr&aacute;ficos, territoriales y de diferentes dimensiones lineales y dem&aacute;s.</span></span></p>\r\n<p><span style=\"font-size: small;\"><span><img style=\"float: right;\" src=\"http://upload.wikimedia.org/wikipedia/commons/thumb/a/aa/Easter_Island_map-es.svg/1024px-Easter_Island_map-es.svg.png\" alt=\"\" width=\"267\" height=\"190\" /></span></span></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>\r\n<p><span style=\"font-size: small;\">Digitalizaci&oacute;n de Planos Topogr&aacute;ficos, Geol&oacute;gicos y Tem&aacute;ticos</span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: small;\">Mapas Topogr&aacute;ficos Escala 1:100,000 - 1:25,000 en cualquier formato</span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: small;\">Mapas Geol&oacute;gicos Escala 1:100,000 - 1:50,000 en cualquier formato</span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: small;\">Escaneo, Georreferenciaci&oacute;n y Digitalizaci&oacute;n de Mapas o Planos</span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: small;\">Elevaci&oacute;n de Curvas de nivel en 3d</span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: small;\">Transformaci&oacute;n de Coordenadas de Psad56 a Wgs84 y viceversa</span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: small;\">Ubicaci&oacute;n de Puntos</span></p>\r\n</li>\r\n<li>\r\n<p><span style=\"font-size: small;\">Habilitaciones Urbanas, Independizaciones</span></p>\r\n</li>\r\n</ul>'),('1217280715060414250822XD','                    <ul>\r\n<li style=\"text-align: justify;\"><span style=\"font-family: arial, helvetica, sans-serif;\">&nbsp;Levantamiento Topogr&aacute;fico de Sitios Arqueol&oacute;gicos (Perimetrico y&nbsp;Curvas de Nivel)&nbsp;</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-family: arial, helvetica, sans-serif;\">Elaboraci&oacute;n de Cuadrillados en campo para unidades de excavaci&oacute;n en&nbsp;sitios arqueol&oacute;gicos.&nbsp;</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-family: arial, helvetica, sans-serif;\">Elaboracion de planos topogr&aacute;ficos en sitios arqueol&oacute;gicos de detalles&nbsp;como plataformas, caminos Inca, arquitectrura, canales, puentes, etc.&nbsp;</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-family: arial, helvetica, sans-serif;\">Elaboracion de planos para Cira (Certificado de Restos Arqueol&oacute;gicos).</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-family: arial, helvetica, sans-serif;\">Elaboracion de Planos Tematicos con fotograf&iacute;as Aereas.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-family: arial, helvetica, sans-serif;\">Digitalizacion de Fotografias Aereas. Con fines arqueol&oacute;gicos.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-family: arial, helvetica, sans-serif;\">Servicios de Drones para fotograf&iacute;as A&eacute;reas y elaboraci&oacute;n de planos&nbsp;en 3D.</span></li>\r\n<li style=\"text-align: justify;\"><span style=\"font-family: arial, helvetica, sans-serif;\">Trabajos con GPS Diferencial y colocaci&oacute;n de Puntos de Control&nbsp;Geod&eacute;sico:&nbsp;</span></li>\r\n</ul>\r\n<address style=\"padding-left: 60px;\"><span style=\"font-family: arial, helvetica, sans-serif;\">Orden A, B, C y D.&nbsp;</span><br /><span style=\"font-family: arial, helvetica, sans-serif;\">Experiencia en Gabinete:</span><br /><span style=\"font-family: arial, helvetica, sans-serif;\">C&aacute;lculo de ajuste de redes geodesias horizontales y verticales</span><br /><span style=\"font-family: arial, helvetica, sans-serif;\">Calculo de transformaci&oacute;n de sistema de coordenadas&nbsp;</span><br /><span style=\"font-family: arial, helvetica, sans-serif;\">Calculo y elaboraci&oacute;n de planta y perfil longitudinal y secciones&nbsp;transversales</span><br /><span style=\"font-family: arial, helvetica, sans-serif;\">Calculo de volumen</span></address>\r\n<p><span style=\"font-family: arial, helvetica, sans-serif;\">&nbsp;</span></p>                    '),('12172807150604142734HDWV','<p style=\"text-align: left;\"><span style=\"font-size: small;\">Construcci&oacute;n civil&nbsp;es el &aacute;rea que engloba a los profesionales destinados a planificar, supervisar y erigir infraestructuras, tomando en cuenta las rigurosas normas de control de calidad al pa&iacute;s que pertenezca.<strong><br /></strong></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\"><strong>Carreteras</strong></span></p>\r\n<ul>\r\n<li><span style=\"font-size: small;\">Levantamientos topogr&aacute;ficos, planos de planta, perfil, obras de arte y&nbsp;</span></li>\r\n<li><span style=\"font-size: small;\">c&aacute;lculo de vol&uacute;menes.&nbsp;</span></li>\r\n<li><span style=\"font-size: small;\">L&iacute;neas&nbsp;</span></li>\r\n<li><span style=\"font-size: small;\">Levantamiento topogr&aacute;fico de l&iacute;neas el&eacute;ctricas, l&iacute;neas de gas,</span></li>\r\n<li><span style=\"font-size: small;\">mineroductos y oleoductos.&nbsp;</span></li>\r\n<li><span style=\"font-size: small;\">Elaboraci&oacute;n de planos de planta, perfil, detalles y fajas de servidumbre</span></li>\r\n</ul>\r\n<p><span style=\"font-size: small;\"><strong>Muelles, Rompeolas</strong></span></p>\r\n<ul>\r\n<li><span style=\"font-size: small;\">Levantamiento batim&eacute;trico, dibujo de planos de planta, perfil, c&aacute;lculo de vol&uacute;menes de corte y relleno detalles.</span></li>\r\n<li><span style=\"font-size: small;\">Ubicaci&oacute;n y control topogr&aacute;fico en hincado de pilotes.</span></li>\r\n</ul>\r\n<p><span style=\"font-size: small;\"><strong>Edificios</strong></span></p>\r\n<ul>\r\n<li><span style=\"font-size: small;\">Trazos y replanteos de cimientos, pernos de anclaje, niveles y planos de</span></li>\r\n<li><span style=\"font-size: small;\">construcci&oacute;n.</span></li>\r\n</ul>\r\n<p><span style=\"font-size: small;\"><strong>Represas</strong></span></p>\r\n<ul>\r\n<li><span style=\"font-size: small;\">Presas de relave y agua, control horizontal y vertical, planos, c&aacute;lculo de&nbsp;vol&uacute;menes, fundaciones y metrados.</span></li>\r\n</ul>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: small;\"><strong>Puentes</strong></span></p>\r\n<ul>\r\n<li><span style=\"font-size: small;\">Batimetr&iacute;a, trazo y replanteo, control topogr&aacute;fico de cimientos, pilotes,</span></li>\r\n<li><span style=\"font-size: small;\">case, etc.</span></li>\r\n</ul>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: small;\"><strong>Montajes</strong></span></p>\r\n<ul>\r\n<li><span style=\"font-size: small;\">Control topogr&aacute;fico en estructuras met&aacute;licas montajes electromec&aacute;nicos&nbsp;y cimientos con pernos de anclaje.</span></li>\r\n</ul>\r\n<p><span style=\"font-size: small;\"><strong>Habilitaciones Urbanas&nbsp;</strong></span></p>\r\n<ul>\r\n<li><span style=\"font-size: small;\">Alquiler de Equipos Topogr&aacute;ficos.</span></li>\r\n<li><span style=\"font-size: small;\">Estaci&oacute;n total</span></li>\r\n<li><span style=\"font-size: small;\">Gps Navegador y Diferencial</span></li>\r\n<li><span style=\"font-size: small;\">Teodolitos</span></li>\r\n<li><span style=\"font-size: small;\">Niveles</span></li>\r\n</ul>\r\n<p>&nbsp;</p>'),('1217280715060414483659IM','<h2 style=\"text-align: left;\"><strong>Miner&iacute;a Subterr&aacute;nea</strong></h2>\r\n<ul>\r\n<li><strong>&nbsp;</strong><strong>Dise&ntilde;o y control topogr&aacute;fico de t&uacute;neles, galer&iacute;as, rampas, chimeneas,&nbsp;</strong><strong>etc.&nbsp;</strong></li>\r\n<li><strong>Levantamiento topogr&aacute;fico y c&aacute;lculo de vol&uacute;menes de mineral y &nbsp;</strong><strong>desmonte en todo tipo de tajos subterr&aacute;neos.&nbsp;</strong></li>\r\n<li><strong>Posicionamiento en trabajos de exploraci&oacute;n y prospecci&oacute;n geol&oacute;gica.</strong></li>\r\n<li><strong>Elaboraci&oacute;n de planos en 3D.</strong></li>\r\n</ul>\r\n<h2><strong>Miner&iacute;a Superficial&nbsp;</strong></h2>\r\n<ul>\r\n<li><strong>Poligonaci&oacute;n y determinaci&oacute;n de puntos de control con equipos GPS&nbsp;</strong></li>\r\n<li><strong>diferencial&nbsp;</strong></li>\r\n<li><strong>Levantamiento al detalle de zonas para exploraci&oacute;n geol&oacute;gicas&nbsp;</strong></li>\r\n<li><strong>C&aacute;lculo de vol&uacute;menes</strong></li>\r\n<li><strong>Control de presas, accesos, pads, botaderos, etc.&nbsp;</strong></li>\r\n<li><strong>Elaboraci&oacute;n de Planos Asbuilt.</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>'),('12172807150604145834BZD4','<p style=\"text-align: left;\"><span style=\"font-size: small;\">Es la&nbsp;ciencia&nbsp;que estudia el conjunto de principios y procedimientos que tienen por objeto la representaci&oacute;n gr&aacute;fica de la&nbsp;superficie terrestre, con sus formas y detalles; tanto naturales como artificiales (v&eacute;ase&nbsp;planimetr&iacute;a&nbsp;y&nbsp;altimetr&iacute;a). Esta representaci&oacute;n tiene lugar sobre superficies planas, limit&aacute;ndose a peque&ntilde;as extensiones de terreno, utilizando la denominaci&oacute;n de &laquo;geodesia</span><span><span style=\"font-size: small;\">&raquo; para &aacute;reas mayores.</span>&nbsp;</span></p>\r\n<ul>\r\n<li><strong>Nivelaci&oacute;n Topogr&aacute;fica Cerrada</strong></li>\r\n<li><strong>Levantamiento Topogr&aacute;fico en Zonas de dif&iacute;cil Acceso.</strong></li>\r\n<li><strong>Establecimiento de V&eacute;rtices Geod&eacute;sicos.</strong></li>\r\n<li><strong>Levantamiento Topogr&aacute;fico con Dise&ntilde;o de Carreteras.</strong></li>\r\n<li><strong>C&aacute;lculo de Movimiento de Tierra.</strong></li>\r\n<li><strong>Monitoreo de Desplazamiento o Asentamientos.</strong></li>\r\n<li><strong>Estudios de Aprovechamiento de Recursos H&iacute;dricos a Nivel Nacional.</strong></li>\r\n<li><strong>Medici&oacute;n de Fincas, Trazado de Carreteras, Segregaciones,</strong><strong>Replanteos, etc.&nbsp;</strong></li>\r\n<li><strong>Catastro Minero.</strong></li>\r\n<li><strong>Nivelaci&oacute;n Diferencial.</strong></li>\r\n<li><strong>Ajuste de Redes y Poligonales Geod&eacute;sicas de Precisi&oacute;n.</strong></li>\r\n<li><strong>Control Geod&eacute;sico Satelital con GPS.</strong></li>\r\n<li><strong>Nivelaci&oacute;n Geod&eacute;sica de Primer y Segundo Orden.</strong></li>\r\n</ul>\r\n<p style=\"text-align: center;\"><strong style=\"text-align: center;\">&nbsp;</strong></p>'),('121728071506091706018RQ0','<p>Tenemos como objeto social: la prevención y mitigación de desastres la gestión de proyectos de habilitación urbana el catastro e ingeniería de valuaciones la auditoría y demarcación territorial el manejo y ordenamiento de cuencas la planificación territorial y proyectos la elaboración de cartografía en general en base de planos, mapas, fotografías a&eacute;reas, imágenes satelitales y base de datos alfanum&eacute;ricos geográficos asesoría y consultoría en materia minera, industrial, agricultura, salud, transporte y educación y estudios hidrológicos, climatológicos y geológicos.</p><p align=\"center\"><img src=\"/imagen/12172807/gestion-territorial-1.gif\" alt=\"\" width=\"582px\" height=\"250px\" data-mce-src=\"/imagen/gestion-territorial-1.gif\" data-mce-selected=\"1\" style=\"border: 0px; cursor: default; outline: black solid 1px; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; background-color: rgb(255, 255, 255);\" title=\"\"></p><p align=\"justify\">Dentro de esta marco legal y situacional, Soluciones Enterprice S.A.C. ofrece a las municipalidades interesadas en promover y administrar una ocupación planificada del territorio y la localización de las actividades económicas; el desarrollo, aplicación y evaluación de un plan de ordenamiento territorial ambientalmente sustentable con instrumentos de ordenamiento y orientación adaptados a las condiciones socioeconómicas y culturales específicas de cada realidad municipal.</p><p align=\"center\"><img src=\"/imagen/12172807/gestion-territorial-2.gif\" alt=\"\" width=\"582px\" height=\"330px\" data-mce-src=\"/imagen/gestion-territorial-2.gif\" data-mce-selected=\"1\" style=\"border: 0px; cursor: default; outline: black solid 1px; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; background-color: rgb(255, 255, 255);\" title=\"\"></p><h2>Entre los Servicios que ofrecemos son :</h2><ul><li>Propuestas de Limites Distritales.</li><li>Plan de Acondicionamiento TerritorialEstudios de Diagnosticos de Zonificacion para la Demarcación Territorial.</li><li>Estudios Territoriales.</li><li>Planes Urbanos Análisis y monitoreo de cuencas Hidrográficas.</li><li>Sistemas de Gestión Municipal.</li></ul><p align=\"center\"><img src=\"/imagen/12172807/gestion-territorial-3.gif\" alt=\"\" width=\"300px\" height=\"188px\" data-mce-src=\"/imagen/gestion-territorial-3.gif\" data-mce-style=\"float: left;\" data-mce-selected=\"1\" style=\"border: 0px; cursor: default; outline: black solid 1px; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; float: left; background-color: rgb(255, 255, 255);\" title=\"\"></p><div><div style=\"text-align: -webkit-center;\"><span style=\"font-size: 10px; font-family: Verdana, Arial, Helvetica, sans-serif;\"><br></span></div><img src=\"/imagen/12172807/gestion-territorial-4.gif\" alt=\"\" width=\"268px\" height=\"188px\" data-mce-src=\"/imagen/gestion-territorial-4.gif\" data-mce-style=\"float: right;\" data-mce-selected=\"1\" style=\"border: 0px; cursor: default; outline: black solid 1px; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; text-align: -webkit-center; float: right; background-color: rgb(255, 255, 255);\" title=\"\"></div>'),('121728071506091708424IU1','                                        <p align=\"justify\" style=\"font-family: Verdana, Arial, Helvetica, sans-serif;\"><span style=\"font-size: 10pt;\">El Catastro es el inventario de bienes inmuebles (terrenos, edificios, etc.), desde esta perspectiva, el catastro es considerado como un sistema de información, basado en la realidad inmobiliaria, como base para el desarrollo económico y social, la administración de las tierras, la planificación urbana y rural, el monitoreo ambiental y el desarrollo local, regional y nacional, de esta manera se constituye entonces, en una herramienta fundamental para garantizar la ordenación del territorio con fines de desarrollo, a trav&eacute;s de la adecuada, precisa y oportuna definición de los tres aspectos más relevantes de la propiedad inmobiliaria: descripción física, situación jurídica y valor económico , convirti&eacute;ndose de esta forma en la fuente primaria de datos del sistema de información territorial, el cual permitirá establecer una base común o red entre las distintas organizaciones públicas y privadas que produzcan información geográfica, cartográfica y catastral del territorio nacional.</span></p><div class=\"cnt_img_sola\" style=\"font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px;\"><img src=\"/imagen/12172807/catastro-urbano.gif\" alt=\"\" width=\"548px\" height=\"382px\" data-mce-src=\"/imagen/catastro-urbano.gif\" style=\"border: 0px; cursor: default;\" title=\"\"></div><h3 style=\"font-family: Verdana, Arial, Helvetica, sans-serif;\">Entre los servicios que ofrece Soluciones Enterprice S.A.C. para los Municipios son:</h3><ul style=\"font-family: Verdana, Arial, Helvetica, sans-serif;\"><li><p><span style=\"font-size: 10px;\">Levantamiento Catastral y/o actualización automatizada de información de servicios (vialidad, redes de </span><span style=\"font-size: 10pt;\">transporte, telefonía, electricidad, salud, educación etc.), necesarios para la gestión Municipal.</span></p></li><li><p><span style=\"font-size: small;\">Generación de base de datos catastrales provenientes del registro de la propiedad.</span></p></li><li><p><span style=\"font-size: small;\">Automatización de la Cartografía digital proveniente del levantamiento fisico.</span></p></li><li><p><span style=\"font-size: small;\">Capacitación e implementación en sistemas catastrales.</span></p></li><li><p><span style=\"font-size: small;\">Diseño e implementación de un Sistema de Información Catastral urbano de acuerdo a los requerimientos de los gobiernos locales.</span></p></li></ul>                                          '),('12172807150609171301F1NG','                                        <p align=\"justify\" style=\"font-family: Verdana, Arial, Helvetica, sans-serif;\"><span style=\"font-size: 10pt;\">Dentro de los trabajos habituales realizados en&nbsp;<strong>Soluciones Enterprice S.A.C.</strong>&nbsp;están los relacionados con la ordenación del territorio. En general la planificación territorial y urbanística se sustenta en análisis previos sobre el territorio en su conjunto.</span></p><p align=\"justify\" style=\"font-family: Verdana, Arial, Helvetica, sans-serif;\"><span style=\"font-size: small;\">El equipo t&eacute;cnico realiza inventarios y diagnósticos de la situación actual del medio físico y de la funcionalidad ecológica del mismo. En función de las características de importancia, singularidad, rareza, vulnerabilidad, fragilidad, conectividad y complejidad, se elaboran valoraciones jerarquizadas y se representan gráficamente en mapas temáticos y de valoración.</span></p><p align=\"justify\" style=\"font-family: Verdana, Arial, Helvetica, sans-serif;\"><span style=\"font-size: small;\">Se realizan tambi&eacute;n análisis paisajísticos, inventarios de bienes de inter&eacute;s cultural, de patrimonio histórico-artístico y arqueológico. Esta información se representa gráficamente, especialmente los relativos al análisis del paisaje, así como los elementos de apoyo para su valoración</span></p><div class=\"cnt_img_sola\" style=\"font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px;\"><img src=\"/imagen/12172807/ordenacion-territorio.gif\" alt=\"\" width=\"206px\" height=\"165px\" data-mce-src=\"/imagen/ordenacion-territorio.gif\" data-mce-style=\"float: left;\" style=\"border: 0px; cursor: default; float: left;\" title=\"\"><img src=\"/imagen/12172807/ordenacion-territorio-1.gif\" alt=\"\" width=\"204px\" height=\"163px\" data-mce-src=\"/imagen/ordenacion-territorio-1.gif\" data-mce-style=\"float: right;\" style=\"border: 0px; cursor: default; float: right;\" title=\"\"><div data-mce-style=\"clear: both;\" style=\"clear: both;\">&nbsp;</div></div><p align=\"justify\" style=\"font-family: Verdana, Arial, Helvetica, sans-serif;\"><span style=\"font-size: 10pt;\">Se contemplan análisis de riesgos naturales, con determinación de zonas inundables y clasificación de especial protección por riesgos de erosión, deslizamientos, erosión, subsidencias, etc. Se representan gráficamente en función de la valoración jerarquizada e importancia de los mismos.</span></p><p align=\"justify\" style=\"font-family: Verdana, Arial, Helvetica, sans-serif;\"><span style=\"font-size: small;\">Estudios socioeconómicos, de infraestructuras (abastecimiento, tratamiento y gestión de aguas y residuos, vías de comunicación, dotaciones,...), completan el análisis previo que sirve de base para la posterior planificación.</span></p>                                          '),('12172807150609171516YOFB','<p style=\"text-align: left;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">La&nbsp;teledetección&nbsp;o&nbsp;detección remota&nbsp;es la adquisición de información a pequeña o gran escala de un objeto o fenómeno, ya sea usando instrumentos de grabación o instrumentos de escaneo en&nbsp;tiempo real&nbsp;inalámbricos&nbsp;o que no están en contacto directo con el objeto (como por ejemplo&nbsp;aviones,&nbsp;sat&eacute;lites,&nbsp;astronave,&nbsp;boyas&nbsp;o&nbsp;barcos).<strong><br></strong></span></p><ul><li><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"><strong>Georeferenciacion y Análisis de Imágenes Satelitales&nbsp;</strong></span></li><li><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"><strong>Generación de DTM y DEM&nbsp;</strong></span></li><li><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"><strong>Ortorectificacion de Imágenes&nbsp;</strong></span></li><li><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"><strong>Preparación de Mosaicos de Imágenes Satelitales&nbsp;</strong></span></li><li><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"><strong>Actualización de Mapas con Imágenes Satelitales&nbsp;</strong></span></li><li><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"><strong>Simulación de Vuelo en 3d y 4d&nbsp;</strong></span></li><li><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"><strong>Evaluación y Monitoreo de los Recursos Naturales.</strong></span></li></ul>'),('121728071506091718278X1Q','                                                                                                                                                                <p><span style=\"font-family: arial, helvetica, sans-serif; font-size: 10pt;\">Gestión ambiental&nbsp;o&nbsp;gestión del medio ambiente&nbsp;al conjunto de diligencias conducentes al manejo integral del sistema ambiental. Dicho de otro modo e incluyendo el concepto de desarrollo sostenible o sustentable, es la estrategia mediante la cual se organizan las actividades antrópicas que afectan al&nbsp;medio ambiente, con el fin de lograr una adecuada calidad de vida, previniendo o mitigando los problemas ambientales.<br></span></p><p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">&nbsp;</span></p><p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\"><img style=\"vertical-align: middle; float: left; border: none;\" src=\"http://www.ismedioambiente.com/wp-content/uploads/2012/01/NAnalyst-560x419.jpg\" alt=\"\" width=\"365px\" height=\"194px\" title=\"\"></span></p><p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">&nbsp;</span></p><p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">&nbsp;</span></p><p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">&nbsp;</span></p><p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">&nbsp;</span></p><p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">&nbsp;</span></p><p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">&nbsp;</span></p><p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">&nbsp;</span></p><p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">&nbsp;</span></p><p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">&nbsp;</span></p><ul><li><p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">Manejo de Cuencas Hidrográficas.&nbsp;</span></p></li><li><p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">Evaluación Ambiental Estrat&eacute;gica (EAE)</span></p></li><li><p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">Evaluación de Impacto Ambiental (EIA)</span></p></li><li><p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">Estudio de Impacto Ambiental</span></p></li><li><p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">Declaración de Impacto Ambiental (DIA)</span></p></li><li><p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">&nbsp;Licencia Ambiental</span></p></li><li><p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">Planificación Ambiental</span></p></li><li><p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">Monitoreo Ambiental</span></p></li><li><p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">Elaboración de Línea Base</span></p></li><li><p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">Programa de Manejo Ambiental</span></p></li><li><p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">Elaboración de Mapas Temáticos para EIA,PAMA</span></p></li><li><p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">Plan de Manejo de Residuos Sólidos</span></p></li><li><p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">Plan de Residuos Solidos</span></p></li></ul>                                                                                                                                                                        '),('121728071506091720563IUG','                                                                                <p>La educación ambiental es un proceso continuo y permanente que busca fortalecer en las personas el conocimiento, la actitud y la práctica de acciones conscientes hacia el desarrollo sostenible.</p><p>&nbsp;Es el proceso que permite al individuo comprender las relaciones de interdependencia con su entorno, a partir del conocimiento reflexivo y crítico de su realidad biofísica, social, política, económica y cultural.</p><p>Este proceso debe generar en el educando y en su comunidad actitudes de valoración y respeto por el ambiente, y de esta manera, propiciar un mejoramiento de la calidad de vida, en una concepción de desarrollo humano que satisfaga las necesidades de las generaciones presentes, asegurando el bienestar de las generaciones futuras.</p><p>Para ello <strong>Soluciones Enterprice S.A.C</strong>&nbsp;se ha especializado en:</p><ul><li>Educación ambiental en instituciones educativas.</li><li>Formación y fortalecimiento de comit&eacute;s ambientales escolares y vecinales.</li><li>Elaboración de recursos comunicacionales.</li><li>Capacitación a docentes.</li><li>Elaboración de materiales educativos.</li><li>Implementación de buenas prácticas ambientales.</li><li>Organización de concursos ambientales.</li><li>Talleres y campañas de sensibilización ambiental.</li></ul><h3>Residuos Solidos:</h3><p>La gestión de residuos se refiere al control y manejo de todo el ciclo de los residuos, desde la generación, separación en la fuente, almacenamiento, recolección selectiva, transporte, tratamiento, reciclaje, transferencia hasta la disposición final; utilizando tecnología adecuada y procedimientos que impliquen el menor impacto negativo.</p><div class=\"cnt_img_sola\"><img style=\"float: left; border: none;\" src=\"/imagen/12172807/proyectos-ambientales-1.gif\" alt=\"\" width=\"300px\" height=\"240px\" title=\"\"><img style=\"float: right; border: none;\" src=\"/imagen/12172807/basura-electronica--02.gif\" alt=\"\" width=\"300px\" height=\"240px\" title=\"\"><div style=\"clear: both;\">&nbsp;</div></div><p>IPES, trabaja la gestión de residuos en base al cumplimiento de la legislación ambiental, con un enfoque preventivo de minimiza-ción de residuos a trav&eacute;s de las 3R (reducción, reuso y reciclaje), involucrando a diversos actores sociales, públicos y privados.<br><br><span class=\"titulo_preguntas color_2\">Para ello IPES se ha especializado en:</span></p><ul><li>Caracterización de residuos.</li><li>Estudios de mercado de residuos.</li><li>Elaboración de Planes Integrales de Gestión de Residuos Sólidos.</li><li>Diseño de infraestructura de manejo de residuos.</li><li>Diseño e implementación de sistemas de recolección selectiva.</li><li>Implementación de Microempresas de Gestión Ambiental (MEGA).</li><li>Gestión de aceites usados.</li><li>Gestión de residuos electrónicos.</li><li>Implementación y administración de Bolsas de Residuos.</li></ul><h3>Gobiernos:</h3><p>La naturaleza de Soluciones Enterprice S.A.C. le permite ejecutar una gran diversidad de proyectos para el Sector Público, para esto identifica problemas y propone soluciones eficientes para múltiples campos del desarrollo estatal, entre los cuales se encuentran:</p><ul><li>Planificación y ordenamiento territorial.</li><li>Censos, demografía y población.</li><li>Delimitación y Titulación Territorial.</li><li>Tributación estatal, Regional o Municipal.</li><li>Sistematización de procesos registrales.</li><li>Zonificación económica.</li><li>Prevención y atención de desastres.</li><li>Evaluación y asignación de riesgos.</li><li>Proyectos Ambientales.</li><li>Evaluación y supervisión de proyectos de diversas índoles <br>Mineria.</li></ul><p>Soluciones Enterprice S.A.C. realiza servicios orientados a la exploración, explotación y administración de proyectos mineros, especializándose en proyectos que requieran topografía y cartografía digital. Además, el área de Medio Ambiente de Soluciones Enterprice S.A.C. desarrolla estudios que buscan definir el equilibrio entre las inversiones y los controles sobre la contaminación del medio ambiente, resolviendo temas como: efluvios mineros hacia ríos y cursos de agua, aguas ácidas, producción de residuos, relaves y alteración del paisaje, entre otros, para lo cual desarrolla estudios de EIA, PAMA, Evaluaciones Ambientales, Prospecciónes y otros relacionados.</p><p class=\"titulo_preguntas color_2\">Entre los servicios brindados destacan:</p><ul><li>Servicios de Fotogrametría y control Terrestre.</li><li>Levantamientos Topográficos.</li><li>Desarrollo de Ortofotos y DTM.</li><li>Elaboración de Sistemas SIG de monitoreo y control.</li><li>Proyectos Medio Ambientales (EIA, PAMA, entre otros).</li><li>Procesamiento de Imágenes Satelitales (Aster, Iconos, Quick bird, Spot).</li><li>Desarrollo de Mapas Geológicos.</li><li>Servicios de Prospección y Evaluación de Cierre de minas.</li><li>Elaboracion de Sistemas SIG para Catastro Minero.</li></ul><h3>Geomarketing:</h3><p>Soluciones Enterprice S.A.C. ofrece servicios de consultoría e investigación en marketing empresarial a entidades financieras y compañías nacionales o extranjeras que requieran de información basada en tecnología de mapeo y bases de datos.</p><p>Sus servicios se orientan a desarrollar y potenciar las decisiones que las empresas tomen respecto a la identificación de la demanda, manejo de bases de datos, planeamiento de actividades por sectores geográficos, entre otros. Entre los servicios que ofrece cuentan:</p><ul><li>Bases de datos catastrales.</li><li>Estudios de mercado.</li><li>Análisis de mercados y zonas de influencia.</li><li>Zonificación de ventas y Geomarketing.</li><li>SIG bancario.</li><li>SIG empresarial de ventas y distribución.</li><li>Mapas de densidad de clientes.</li><li>Mapas de ubicación de cajeros automáticos.</li><li>Verificación domiciliaria y comercial</li></ul>                                                                                    '),('12172807150609172243M4I9','                                        <p align=\"justify\" style=\"font-family: Verdana, Arial, Helvetica, sans-serif;\"><span style=\"font-size: 10pt;\">El&nbsp;<strong>Ordenamiento Ambiental</strong>&nbsp;es el instrumento esencial para la integración de las variables de la dimensión ambiental en las acciones para el desarrollo, buscando armonizar la oferta ambiental con la demanda del desarrollo sostenible, a trav&eacute;s de un apropiado ordenamiento de la ocupación del territorio basado en la identificación y asignación de áreas de especialización y complementariedad productiva</span></p><p align=\"justify\" style=\"font-family: Verdana, Arial, Helvetica, sans-serif;\"><span style=\"font-size: small;\"><strong>Tenemos por objeto social:</strong>&nbsp;la evaluación, estudio y monitoreo ambiental el ecoturismo y reactivación económica PAMA s proyectos de saneamiento ambiental planificación y manejo de áreas verdes la auditoría ambiental restauración y reforestación de áreas intervenidas cursos, seminarios y talleres acerca de la conservación de la calidad ambiental, uso sostenible de los recursos naturales y la educación ambiental la comercialización, distribución, representación comercial, importación y exportación de productos y subproductos derivados de los recursos naturales la asesoría y consultoría en materia minera, industrial, agricultura, salud, transporte y educación y estudios hidrológicos, climatológicos y geológicos.</span></p>                                          '),('12172807150609172434NE8M','                    <p>La generación y disposición de los residuos es conocida como una de las problemáticas ambientales más importantes, tanto a nivel local como mundial.</p><p>El problema es muy complejo debido al crecimiento de la población y del consumo, y a la dinámica de los ecosistemas receptores. Las consecuencias sobre el medio físico y biológico así como sobre la salud son graves si no se lleva a cabo un tratamiento adecuado.</p><p>A nivel empresa, industria o comunidad, los residuos se convierten a corto y largo plazo en un problema que de no ser prevenido, trae serios problemas en la salud de la población y en el ambiente.</p><p>Gestionar los residuos de forma integral implica un análisis y control en todo su ciclo: desde la generación, el almacenamiento, la recolección, el transporte y el procesamiento, hasta la disposición final. Una gestión integral implica, además, la selección y aplicación de t&eacute;cnicas, tecnologías y programas de manejo acordes con objetivos específicos relacionados con políticas de reducción, reciclaje y reutilización. Estas se basan en criterios sanitarios, ambientales y económicos.</p><p>Con simples t&eacute;cnicas de minimización, recolección, acopio y tratamiento se puede reducir significativamente el impacto ambiental y hasta lograr convertir los desechos en un subproducto para la venta. Así se evitan costos, riesgos para la salud y el ecosistema y se aprovechan mejor recursos energ&eacute;ticos y materias primas.</p><div class=\"cnt_img_sola\"><img style=\"float: left; border: none;\" src=\"/imagen/12172807/gestion-residuos.gif\" alt=\"\" width=\"255px\" height=\"204px\" title=\"\"><img style=\"float: right; border: none;\" src=\"/imagen/12172807/gestion-residuos-2.gif\" alt=\"\" width=\"256px\" height=\"205px\" title=\"\"><div style=\"clear: both;\">&nbsp;</div></div><p>La población es cada vez más consciente de los problemas que implica la contaminación por basurales a cielo abierto, efluentes industriales, residuos peligrosos, etc. En especial en lugares de alta biodiversidad o valor paisajístico donde el deterioro del medio (calidad del aire, agua, suelo y paisaje), a parte de los efectos directos sobre la salud, perjudica el funcionamiento de las economías regionales.</p><p>Para hacer frente a esta problemática la educación y capacitación ambiental, el cambio en las prácticas y costumbres de consumo, la incorporación de tecnologías y t&eacute;cnicas para recolectar, tratar y disponer los residuos, son herramientas de gestión que pueden estar combinadas de acuerdo a necesidades específicas dentro de un Programa de Gestión Integral de Residuos. Estos programas se diseñan a medida dependiendo de las características del la comunidad o de la organización que los solicite.</p><h3>Soluciones Enterprice S.A.C. brinda&nbsp; soluciones ambientales orientados para mejorar la calidad de vida de los habitantes los cuales son:</h3><ul><li>Proyectos de Inversión Pública en el marco del SNIP.</li><li>Expedientes T&eacute;cnicos de Proyectos de Inversión Pública.</li><li>Estudios de Impacto Ambiental de proyectos de infraestructura de residuos sólidos.</li><li>Proyectos de Infraestructura para gestión de residuos sólidos: rellenos sanitarios, plantas de tratamiento, recuperación y reciclaje.</li><li>Plan de recuperación de botaderos.</li><li>Proyectos de Biodigestores.</li><li>Planes Integrales de Gestión Ambiental de Residuos Sólidos (PIGARS).</li><li>Planes Distritales de Gestión Ambiental de Residuos Sólidos (PDGARS).</li><li>Estudios de caracterización de residuos sólidos (ECRS).</li></ul><p align=\"justify\"><strong>Soluciones Enterprice S.A.C.</strong> es líder en evaluaciones de Impacto ambientales en formulación, evaluación y promoción de proyectos de desarrollo sustentable. Conocemos a fondo la estructura económica y social de una amplia gama de sectores y regiones y, además, tenemos una capacidad singular para diseñar políticas sectoriales y transversales desde una concepción multidisciplinaria integradora de los enfoques económico, social, ambiental, comunicacional y de ingeniería.</p><h3>Estamos a disposición de las empresas privadas, entidades públicas y organismos cooperantes para servirlos con las mejores prácticas de consultoría y asesoría en:</h3><ul><li>EIA de proyectos de carreteras.</li><li>EIA de proyectos portuarios y aeroportuarios.</li><li>EIA de proyectos hidroenerg&eacute;ticos.</li><li>EIA de proyectos petroleros.</li><li>EIA de proyectos de energía renovable.</li><li>EIA de planes de competitividad sectorial y de productos.</li><li>Planes de desarrollo regional y local.</li><li>Planes de integración macroregional.</li><li>Planes de desarrollo de cuencas.</li><li>Diagnósticos ambientales.</li><li>Cuantificación y mitigación de riesgos ambientales.</li><li>Estudios de integración paisajística.</li><li>Estudios de sostenibilidad ambiental.</li><li>Estudios de factores y condicionantes ambientales de proyectos nuevos <br>Diseño de políticas ambientales.</li><li>Manejo de conflictos medioambientales y facilitación de soluciones.</li></ul>                     '),('121728071506091726295WKF','                                                            <p align=\"justify\">Un <strong>EIA</strong> es un procedimiento jurídico, administrativo y t&eacute;cnico cuyo objetivo es estimar y evaluar la alteración generada en el ambiente como consecuencia de un proyecto o actividad con el fin de determinar su viabilidad del punto de vista físico, biológico, socioeconómico, jurídico, etc.</p><p align=\"justify\">Toda obra implica un impacto en el ambiente: un cambio, positivo o negativo, en el medio receptor del proyecto.</p><p align=\"justify\">El <strong>EIA</strong> es una herramienta de gestión ambiental fundamental dentro de la planificación y toma de decisiones ya que, previo a la ejecución de un proyecto, emprendimiento o actividad permite evaluar y ponderar la dimensión de sus impactos en el medio para poder evitar, minimizar o compensar posibles daños. Incorpora las variables ambientales más significativas a lo largo de todo el ciclo del proyecto y de este modo incluye los costos ambientales al análisis de factibilidad.</p><div class=\"cnt_img_sola\"><img style=\"float: left; border: none;\" src=\"/imagen/12172807/evaluacion-impacto-ambiental-1.gif\" alt=\"\" width=\"300px\" height=\"240px\" title=\"\"><img style=\"float: right; border: none;\" src=\"/imagen/12172807/ambiental.gif\" alt=\"\" width=\"300px\" height=\"240px\" title=\"\"><div style=\"clear: both;\">&nbsp;</div></div><p>Al interpretar los impactos susceptibles de ser generados desde las etapas más tempranas del proyecto, ya sean negativos o positivos, se puede identificar aquellas alternativas que impliquen una mayor compatibilidad con el ambiente.</p><p>El Estudio de Impacto Ambiental <strong>(EsIA)</strong> corresponde a la etapa t&eacute;cnica de la evaluación que, de acuerdo al tipo de proyecto, puede incluir un Plan de Gestión Ambiental y un Programa de Monitoreo.</p><p>Se basa dentro de un determinado marco legal en la descripción de las actividades propias del proyecto y de su línea de base (medio sin proyecto), y en la descripción y evaluación de los impactos identificados. Esto permite tomar medidas de revención, mitigación o compensación así como realizar un seguimiento de las tendencias a futuro una vez que la obra est&eacute; operando.</p><p>Un equipo interdisciplinario formado por profesionales de distintas especialidades como gestores ambientales, biólogos, geólogos, antropólogos, químicos, etc. son los encargados de llevar adelante esta <strong>EIA</strong>, con el objeto de cumplir con los lineamientos del proyecto basándose en los principios rectores del desarrollo sustentable.</p>                                                               '),('12172807150609184051Q48W','                    <div><span style=\"font-size: 10px; font-family: Verdana, Arial, Helvetica, sans-serif;\"><br></span></div><ul style=\"font-family: Verdana, Arial, Helvetica, sans-serif;\"><li><span style=\"font-size: 10pt;\">Determinar ubicación para construcciones: centros m&eacute;dicos, supermercados, escuelas, áreas verdes, entre otros.</span></li><li><p><span style=\"font-size: small;\">Determinar zonas ambientales: potenciales</span></p></li><li><p><span style=\"font-size: small;\">Uso del territorio, atractivo turístico y económico (recaudación de fondos).</span></p></li><li><p><span style=\"font-size: small;\">Zonas de equipamiento, servicios, protección social.</span></p></li><li><p><span style=\"font-size: small;\">Monitoreo con imágenes satelitales, planos para la focalización de recursos de su empresa, entre otros</span></p></li></ul>                     '),('12172807150609194111TMCF','                                                            <h3>1)DESCRIPCION DEL CURSO.</h3><p>Curso &nbsp;para &nbsp;generar modelos &nbsp;de forma estructurara y agilizar procesos rutinarios.</p><h3><strong>2)ESTA CAPACITACIÓN VA DIRIGIDO A:</strong></h3><ul><li>&nbsp;Profesionales que buscan conocimiento en el modelamiento de procesos.</li></ul><h3>3)REQUERIMIENTOS BRINDADOS.</h3><ul type=\"disc\"><li>Traer laptop, de nuestra parte brindaremos un proyector Multimedia &nbsp;para las exposición de las clases.</li><li>Se brindara certificado a nombre de SOLUCIONES ENTERPRICE SAC a los participantes que cumplen el 100% de Asistencia.</li><li>Se entregara un Manual de Usuario en español para cada participante del curso a desarrollarse.</li><li>Se entregara información digital trabajada en clase e información bibliografía</li><li>Seleccionada en un CD por cada participante.</li></ul><h2><strong>5) Horarios e Inicio:</strong></h2><ul><li>Segun Coodinacion contactarse a los num