QPZ','<h3>1)DESCRIPCION DEL CURSO.</h3><p>construcción de repositorios de datos Cartográficos, modelamiento, entidad relación, modelo lógico y conceptual de datos cartográficos.</p><h3><strong>2)ESTA CAPACITACIÓN VA DIRIGIDO A:</strong></h3><ul><li>&nbsp;Profesionales que buscan introducirce a creacion de base de datos cartografica con herramientas GIS.</li></ul><h3>3)REQUERIMIENTOS BRINDADOS.</h3><ul type=\"disc\"><li>Traer laptop, de nuestra parte brindaremos un proyector Multimedia &nbsp;para las exposición de las clases.</li><li>Se brindara certificado a nombre de SOLUCIONES ENTERPRICE SAC a los participantes que cumplen el 100% de Asistencia.</li><li>Se entregara un Manual de Usuario en español para cada participante del curso a desarrollarse.</li><li>Se entregara información digital trabajada en clase e información bibliografía</li><li>Seleccionada en un CD por cada participante.</li></ul><h2><strong>5) Horarios e Inicio:</strong></h2><ul><li>Segun Coodinacion contactarse a los numeros y correos ubicados en la Inscripcion.</li></ul><h2>8)INCRIPCION</h2><p>Números de Consulta: 987440590 o&nbsp;(51) 722-0864&nbsp;</p><p>El proceso de Inscripción es limitado, se realiza vía correo electrónico, el cual se inicia llenando la Ficha de Inscripción enviado por la empresa según su solicitud,<br>luego del cual recibirá la autorización de inscripción en el curso y posteriormente la autorización del pago del curso, esto se realizara por correo electrónico al e-mail:</p><p>&nbsp;<a href=\"mailto:soluciones_enterprise@hotmail.com\">soluciones_enterprise@hotmail.com</a>&nbsp;o&nbsp;<a href=\"mailto:soluciones@geoenterprice.com\">soluciones@geoenterprice.com</a>&nbsp;o&nbsp;<a href=\"mailto:consultorgis@hotmail.com\">consultorgis@hotmail.com</a>.</p>'),('12172807150610080759OYU2','<h3>1)¿PORQUE LLEVAR ESTE CURSO?</h3><p>El curso va dirigido a todos aquellos profesionales que desean adquirir los conocimientos prácticos y teóricos para manejar la base de datos Postgre y su manejadir visual PGadmin III. Entre algunos de los temas que se ven en este curso se encuentran la instalación, la carga de datos espaciales, la indexación espacial, las consultas &nbsp;SQL.</p><h3><strong>2)ESTA CAPACITACIÓN VA DIRIGIDO A:</strong></h3><ul><li>&nbsp;Profesionales que buscan perfeccionarse a un nivel de desarrollo en temas relacionados a la base de datos open source.</li></ul><h3>3)OBJETIVOS</h3><ul><li>Conocer en cómo hacer consultas a la base de datos&nbsp;</li><li>Entender el funcuinamiento de la BD &nbsp;</li></ul><h3>4)METODOLOGIA</h3><p>La capacitación se desarrollara según el temario enviando, el cual será teórico prácticotemario del Curso en Base de datos espacial&nbsp; con PostGreSQl.</p><ul><li><strong>Uso,&nbsp; Instalación y Clientes SQL.</strong></li></ul><p>Estándares OGC y SQL/MM. Instalación de PostgreSQL y PostGIS. Utilización de los clientes PSQL y Pgadmin III. Creación de nuevas bases de datos con psql,pgadmin3 y SQL.</p><ul><li><strong>Definición de Datos</strong></li></ul><p>Tablas y dominios: Definición, creación, modificación y borrado de tablas y dominios. Restricciones: Valor no nulo, unicidad, clave primaría, restricción general.</p><ul><li><strong>Consulta e ingreso de datos</strong></li></ul><p>Inserción, actualización y borrado de registros en una tabla. Consultas elementales sobre una tabla. Funciones SQL. Funciones agregadas. Consultas sobre varias tablas:</p><ul><li><strong>Administración Básica de la Base de Datos</strong></li></ul><p>Copias de seguridad y restauración del proyecto, pg_dump. Creación de roles y sus permisos. Gestión de permisos de los objetos en SQL (Grant). Configuración del sistema de registro log de PostgreSQL.</p><h3>5)REQUERIMIENTOS BRINDADOS.</h3><ul type=\"disc\"><li>Traer laptop, de nuestra parte brindaremos un proyector Multimedia &nbsp;para las exposición de las clases.</li><li>Se brindara certificado a nombre de SOLUCIONES ENTERPRICE SAC a los participantes que cumplen el 100% de Asistencia.</li><li>Se entregara un Manual de Usuario en español para cada participante del curso a desarrollarse.</li><li>Se entregara información digital trabajada en clase e información bibliografía</li><li>Seleccionada en un CD por cada participante.</li></ul><h3>6)IVERSION:</h3><p>Es costo del curso por participante es s/ 400.00 (Cuatrocinentos Nuevos soles)&nbsp;<br>No incluye IGV</p><p>&nbsp;</p><h3>7)INICIO:</h3><ul><li>Segun Coodinacion contactarse a los numeros y correos ubicados en la Inscripcion.</li></ul><h3>8)INCRIPCION</h3><p>Números de Consulta: 987440590 o&nbsp;(51) 722-0864&nbsp;</p><p>El proceso de Inscripción es limitado, se realiza vía correo electrónico, el cual se inicia llenando la Ficha de Inscripción enviado por la empresa según su solicitud,<br>luego del cual recibirá la autorización de inscripción en el curso y posteriormente la autorización del pago del curso, esto se realizara por correo electrónico al e-mail:</p><p>&nbsp;<a href=\"mailto:soluciones_enterprise@hotmail.com\">soluciones_enterprise@hotmail.com</a>&nbsp;o&nbsp;<a href=\"mailto:soluciones@geoenterprice.com\">soluciones@geoenterprice.com</a>&nbsp;o&nbsp;<a href=\"mailto:consultorgis@hotmail.com\">consultorgis@hotmail.com</a>.</p>'),('121728071506100810363OB6','                                                            <p><strong>1) ¿PORQUE LLEVAR ESTE CURSO?</strong></p><p>Esta capacitación está dirigida para personas con conocimientos en SIG y Manejadores de Base de datos espaciales como Post GIS para la elaboración BDE en un entorno OpenSource dando así competitividad en el mercado.</p><p><strong>Esta capacitación va dirigido a:</strong></p><p>• Profesionales que buscan perfeccionarse a un nivel avanzado en temas relacionados a la Geomántica y que buscan incrementar su productividad extendiendo las aplicaciones GIS &nbsp;a medida del cliente con software Libre y programación .net.<br>• &nbsp;A todo profesional que quiere iniciarse en temas de Base de datos espaciales con software libre