sultor&iacute;a de topograf&iacute;a, cartograf&iacute;a y sistemas de informaci&oacute;n geogr&aacute;fica.Este abanico de servicios nos permite abarcar todo el proceso relacionado con la informaci&oacute;n geogr&aacute;fica, desde la toma de datos de campo, hasta la edici&oacute;n del mapa o la publicaci&oacute;n de geodatos en internet o DVD..</p>','','','','','','',NULL,NULL,'2015-05-31','','si',NULL,NULL,NULL,NULL,NULL),(89,'12172807','Ordenamiento del Territorio',3,'1','1','/imagen/12172807/gpsdife2.jpg',190,180,'/servicios/ordenacion-del-territorio','',NULL,'',NULL,'',0,'','2',0,'0','0','0','0','','0000-00-00','0000-00-00',0,0,'','',NULL,NULL,'','',NULL,NULL,'','',NULL,NULL,'','',NULL,NULL,'','',NULL,NULL,'2015-05-31','','si',NULL,NULL,NULL,NULL,NULL),(90,'12172807','Topografía',3,'1','1','/imagen/12172807/topo1.jpg',190,170,'/servicios/topografia','',NULL,'',NULL,'',0,'','4',0,'0','0','0','0','','0000-00-00','0000-00-00',0,0,'','',NULL,NULL,'','',NULL,NULL,'','',NULL,NULL,'','',NULL,NULL,'','',NULL,NULL,'2015-05-31','','si',NULL,NULL,NULL,NULL,NULL),(91,'12172807','Bienvenidos a Soluciones Enterprice S.A.C.',4,'1','3','',NULL,NULL,'','Soluciones Enterprice S.A.C. es un conjunto de profesionales multidisciplinario de investigación, consultoría y docencia, que opera con sede en Lima, oficinas descentralizas. Soluciones Enterprice S.A.C. posee una amplia organización adecuada para desarrollar distintos tipos de consultorías, para lo cual cuenta con las siguientes áreas técnicas: Proyectos. Topografía. Información Geográfica. Geomarketing. Gestión Territorial. Catastro Urbano. Impacto Ambiental. Gestión de Residuos. Educación Ambiental. Ordenación del Territorio. Ordenamiento Ambiental.',NULL,'',NULL,'',0,'','3',0,'0','0','0','0','','2015-05-31','0000-00-00',0,0,'','',NULL,NULL,'','',NULL,NULL,'','',NULL,NULL,'','',NULL,NULL,'','',NULL,NULL,'2015-05-31','','si',NULL,NULL,NULL,NULL,NULL),(92,'12172807','CURSOS',2,'1','4','',NULL,NULL,'','','1812','1100','12172807